import React from "react";

const Header = () => {
  const renderedItems = () => {
    //fix this alignment later. Cannot get the header aligned in center
    return (
      <div className='ui header container menu'>
        <div className='ui justified header'>Header</div>

        <div className='right menu'>
          <button className='ui primary button'>Login</button>

          <button className='ui button green'>Sign Up</button>
        </div>
      </div>
    );
  };

  //fix this alignment later. Cannot get the header aligned in center
  return <div className='ui'>{renderedItems()}</div>;
};

export default Header;
